// init msg
msg = {"headers": {}};

// set method
msg.method = "GET";

//set url
msg.url = flow.get("dataserviceUrl") + "/DataService/Variables";

// set token header
msg.headers["authorization"] = flow.get("accessToken");

return msg;

// create out message
let outMsg    = {"payload": null};

// get names of variables to be extracted from Data Service app
let varName = env.get("variablesNames");
let varNameArray = varName.split(",");

// create object with {key:value} as {name:id} of variables
let vars = {};
for(i=0; i<varNameArray.length; i++){
    vars[varNameArray[i]]  = []; 
}

// iterate through readed tags
for (let i=0; i < varNameArray.length; i++){

    // iterate through selected ids
    for(let j=0; j < msg.payload.variables.length; j++){

        // search for tagselectedTags[j]
        if(varNameArray[i] == msg.payload.variables[j].variableName)
        {
            vars[varNameArray[i]] = msg.payload.variables[j].variableId;
            // stop on first match, ids are uniques
            break;
        }
    }
}
//node.send(vars);
if (Object.keys(vars).length > 0) {
    flow.set("variablesIds", vars);
    // set status
    outMsg.payload = {
      "fill": "green",
      "shape": "dot",
      "text": "Connected and Configured for reading " + Object.keys(vars).length + " variables."
    };
} 
else {
    flow.set("variablesIds", null);
}

return outMsg;

let out1 = {};
let out2 = {};
let dataBuffer = flow.get("dataBuffer") || {};
let variablesIds = flow.get("variablesIds");

if (Object.keys(dataBuffer).length == 0) {
    flow.set("startTime", new Date().getTime());
    for(i=0; i<Object.keys(variablesIds).length; i++){
        dataBuffer[Object.keys(variablesIds)[i]]  = []; 
    }
}

let newDataBuffer = dataBuffer;

for(j=0; j<msg.payload.data.length; j++){
    index = Object.values(variablesIds).indexOf(msg.payload.data[j].variableId);
    newDataBuffer[Object.keys(variablesIds)[index]] = dataBuffer[Object.keys(variablesIds)[j]].concat(msg.payload.data[j].values);
}

flow.set("dataBuffer", newDataBuffer);

if (msg.payload.hasOwnProperty("hasMoreData")) {
    let status = {"payload": {
      "fill": "green",
      "shape": "dot",
      "text": "Querying data in progress..."
    }};
    out1.from = new Date(msg.payload.hasMoreData.from);
    out1.to = new Date(msg.payload.hasMoreData.to);
    return [out1, null, status];
} else {
    let status = {"payload": {
      "fill": "green",
      "shape": "dot",
      "text": "Query completed on " + new Date().toISOString()
    }};
    out2.topic = env.get("variablesName");
    out2.payload = newDataBuffer;
    flow.set("dataBuffer", {});
    out2.queryTime = new Date().getTime() - flow.get("startTime");
    return [null, out2, status]
}

