The aim of this node is to prepare the data received from "DataService Read Variable" node, in order to visualize them into a dedicated dashboard.

The time series data format will be the following:

[{
"series": ["VarA", "VarB", "VarC"],
"data": [
    [{ "x": "20/10/2021 20:50:50", "y": 5 },
     { "x": "20/10/2021 20:50:50", "y": 6 },
     { "x": "20/10/2021 20:50:50", "y": 7 }
    ],
    ...,
    [{ "x": "20/10/2021 20:51:50", "y": 8 },
     { "x": "20/10/2021 20:51:50", "y": 9 },
     { "x": "20/10/2021 20:51:50", "y": 10 }
    ]
],
"labels": [""]
}]

The graph in the dasboard will show the timestamps on the x-axis and the values of the tags on the y-axis.

