let data = {"timestamp": []};

for(i=0;i<Object.keys(msg.payload).length;i++){
    let variable = Object.values(msg.payload)[i];
    for (j=0;j<variable.length;j++){
        let newTs = new Date(variable[j].timestamp).getTime()
        if(data.timestamp.indexOf(newTs) == -1){
            data.timestamp.push(newTs);  
        }
    }
}

data.timestamp.sort((a,b)=>a-b).map((el) => {return new Date(el)});

for(k=0;k<data.timestamp.length;k++){
    data.timestamp[k] = new Date(parseInt(data.timestamp[k])).toISOString();
}

for(i=0;i<Object.keys(msg.payload).length;i++){
    data[Object.keys(msg.payload)[i]] = new Array(data.timestamp.length).fill(null);
    let variable = Object.values(msg.payload)[i];
    for(j=0;j<variable.length;j++){
        let index = data.timestamp.indexOf(variable[j].timestamp);
        if(index > -1){
            data[Object.keys(msg.payload)[i]][index] = variable[j].value
        }    
    }
}

let buffer = [];
// Go through all data elements and organize them as [{a: "", b: ""}, {a: "", b: ""},...,{a: "", b: ""}]
for(i=0;i<data.timestamp.length;i++){
    let newRow = {"timestamp": data.timestamp[i]};
    let columns = Object.keys(msg.payload);
    for(j=0;j<columns.length;j++){
        newRow[Object.keys(msg.payload)[j]] = data[Object.keys(msg.payload)[j]][i];
    }
    buffer.push(newRow);
}

// Define CSV columns name
msg.columns = Object.keys(data).join(",");
msg.payload = buffer;
msg.topic = env.get("variablesName");
return msg;
